import React, {Component} from 'react';
import NavBar from './components/NavBar';
import { Router } from 'react-router-dom';
import { Switch } from '@material-ui/core';

class App extends Component{


    render(){
        return(

            <div>
                <NavBar/>
                <Router>
                    <Switch>
                        <Route path="/">
                            Hi
                        </Route>
                        <Route path="/test">
                            Test
                        </Route>
                    </Switch>
                </Router>
            </div>
        )
    }
}


export default App
